elements.expression:
image mode="contain" dataurl={
 asset {
   demodata | tail {math 'round(random() * 3 + 1)'} |
   getCell "state" row=0 |
   if {compare eq to="done"} then="asset-15ee22ca-71a3-4a72-b20d-80401a26798c" else={
    if {compare eq to="running"} then="asset-8eb90ec1-4c87-4b61-8c76-caddf23e543c" else="asset-9b9fab30-2ab7-4233-a1d6-252679c74166"
   }
 }
} | render

filters | demodata 
| pointseries color="country" size="sum(price)" 
| staticColumn total value={math 'sum(size)'} 
| mapColumn percent fn=${math 'size/total * 100'} 
| mapColumn color 
  fn=${
    if {getCell percent | compare lt to=3} 
    then=Other 
    else={getCell color}
    }
| pointseries size="sum(percent)" color=color
| pie palette={palette "#CCC7DF" "#130351" gradient=true} font={font family="'Open Sans', Helvetica, Arial, sans-serif" size=12 align="left" color="#FFFFFF" weight="normal" underline=false italic=false} | render
